using System;
using System.Threading;

using UnitySC.PM.ANA.Service.Core.TSV;
using UnitySC.PM.ANA.Service.Interface.Algo;
using UnitySC.PM.ANA.Service.Interface.Recipe.Measure.MeasureSettings;
using UnitySC.Shared.Tools.Units;

namespace UnitySC.PM.ANA.Service.Core.Dummy
{
    public class TSVDepthFlowDummy : TSVDepthFlow
    {
        public TSVDepthFlowDummy(TSVDepthInput input) : base(input)
        {
        }

        protected override void Process()
        {
            var rnd = new Random();

            Thread.Sleep(150);

            Result.Depth = (Input.ApproximateDepth.Micrometers + 1.2 * (rnd.NextDouble() * (2.0 * Input.DepthTolerance.Micrometers) - Input.DepthTolerance.Micrometers)).Micrometers(); ;
            Result.Quality = rnd.NextDouble() * 100.0;

            switch (Input.Probe)
            {
                case SingleLiseSettings singleLiseSettings: 
                    break;

                case LiseHFSettings liseHFSettings:
                    LiseHFSettings settings = (Input.Probe) as LiseHFSettings;
                    if (settings.SaveFFTSignal)
                    {
                        Result.DepthRawSignal = SaveDepthFFTSignalMemory_Dummy();
                    }
                    break;

                default:
                    throw new Exception("Probe not supported to measure a TSV");
            }

            Logger.Information($"{LogHeader} TSVDepth {Result.Depth}", Result);
        }

